import React from "react";
import { TextField, Grid, Paper } from "@mui/material";
export function Login() {
  return (
    <div>
      <p>login pagejjs</p>
      <div>
        <Grid>
          <Paper>
            <div>
              <TextField lable="standard" label="Username" />
              <TextField lable="outlined" label="Email" type="email" />
              <TextField lable="filled" label="Password" type="password" />
            </div>
          </Paper>
        </Grid>
      </div>
    </div>
  );
}
